import LeftNav from "./navbar/LeftNav";
import RightNav from "./navbar/RightNav";

const Navbar = () => {
  return (
    <div className="Navbar flex justify-between px-2 py-7 items-center border-b-2 border-gray-300  ">
      <LeftNav />
      <RightNav />
    </div>
  );
};

export default Navbar;
